import React, {Component} from 'react'
import './Register.css'


export default class Register extends Component {
    render() {
        return(
            <div className="login">
                <div className="login-triangle"></div>

                <p className="login-header"><strong>S</strong>kelters</p>

                <form className="login-container">
                    <p><input name="nom" type="text" placeholder="Nom"/></p>
                    <p><input name="prenom" type="text" placeholder="Prenom"/></p>
                    <p><input name="email" type="text" placeholder="Email"/></p>
                    <p><input name="disponibilite" type="text" placeholder="Disponibilite"/></p>
                    <p><input name="secteur" type="text" placeholder="Secteur d'activite"/></p>
                    <p><input name="password" type="password" placeholder="Password"/></p>
                    <p><input type="submit" value="LOGIN"/></p>
                </form>
            </div>
        );
    }
}
